--
-- Disparadores `detalle_presupuesto`
--
DELIMITER $$
CREATE TRIGGER `tr_updStockPresupuesto` AFTER INSERT ON `detalle_presupuesto` FOR EACH ROW BEGIN
                UPDATE articulo SET stock = stock - NEW.cantidad
                WHERE articulo.idarticulo = NEW.idarticulo;

                IF EXISTS(SELECT * FROM estadistica_venta WHERE estadistica_venta.idarticulo = NEW.idarticulo)THEN
                  UPDATE estadistica_venta SET cantidad = cantidad + NEW.cantidad
                  WHERE estadistica_venta.idarticulo = NEW.idarticulo;
                  UPDATE estadistica_venta SET precio_venta = precio_venta + NEW.precio_venta
                  WHERE estadistica_venta.idarticulo = NEW.idarticulo;
                ELSE
                  VALUES(NEW.idarticulo,NEW.cantidad,NEW.precio_venta,NOW());
                END IF;
            END
$$
DELIMITER ;

